import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useLocation
  } from "react-router-dom";

export default function RouterParams() {
    return (
        <Router>
            <div>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/dashboard">Dash board</Link>
                    </li>
                    <li>
                        <Link to="/404">404</Link>
                    </li>
                </ul>

                <hr />
                <Switch>
                    <Route exact path="/">
                        <Home />
                    </Route> 
                    <Route path="/dashboard">
                        <Dashboard />
                    </Route> 
                    <Route path="*">
                        <NotFound />
                    </Route> 
                </Switch>
            </div>
        </Router>
    );
}

function Home() {
    return (
        <div>
            <h2>Home</h2>
        </div>
    );
}

function Dashboard() {
    return (
        <div>
            <h2>Dashboard</h2>
        </div>
    );
}

function NotFound() {
    let location = useLocation()
    console.log(location);
    return (
        <div>
            <h2>404 Not Found</h2>
        </div>
    );
}
